    typedef boost::zeta_grid_graph<4> Graph;
    typedef boost::graph_traits<Graph>::vertex_descriptor Vertex;
    typedef boost::graph_traits<Graph>::vertices_size_type VertexIndex;
    typedef boost::graph_traits<Graph>::edge_descriptor Edge;
    typedef boost::graph_traits<Graph>::edges_size_type EdgeIndex;
    typedef boost::graph_traits<Graph>::degree_size_type DegreeIndex;
    typedef boost::vertex_dimension_trait<Graph>::type DimensionT;
    typedef boost::edge_key_trait<Graph>::type EdgeKey;

    Vertex dimensions = {{3, 3, 3, 3}};
    std::tr1::array<bool,4> wraparound = {{false, false, true, true}};
    Graph graph(dimensions, wraparound);

    // Verify dimension lengths and wrapping.
    for (
        DimensionT d = boost::initialized_value;
        d < graph.dimensions();
        ++d
    )
    {
        BOOST_CHECK(dimensions[d] == graph.length(d));
        BOOST_CHECK(wraparound[d] == graph.wrapped(d));
    }

    // Verify that all vertices are within bounds.
    BOOST_FOREACH(Vertex v, boost::vertices(graph))
    {
        for (
            DimensionT d = boost::initialized_value;
            d < graph.dimensions();
            ++d
        )
        {
            BOOST_CHECK(v[d] < graph.length(d));
        }
    }

    test_indices_and_incidence(graph);

    // Verify structure.
    BOOST_CHECK(81 == boost::num_vertices(graph));
    BOOST_CHECK(80 == boost::num_edge_keys(graph));

